    //burbuja pa' ordenar de menor distancia a mayor 
    HomePage.prototype.menorDistancia = function (arr) {
        for (var i = 1; i < arr.length; i++) {
            for (var j = 0; j < (arr.length - i); j++) {
                if (arr[j].distance > arr[j + 1].distance) {
                    var aux = arr[j];
                    arr[j] = arr[j + 1];
                    arr[j + 1] = aux;
                }
            }
        }
        return arr;
    };
